import React from 'react';
import TaskList from './TaskList';

const TasksShownPage = ({ tasks, onDeleteTask, onUpdateTask }) => {
  return (
    <div>
      <h2>Tasks Shown</h2>
      {tasks.length === 0 ? (
        <p>No tasks found.</p>
      ) : (
        <TaskList 
          tasks={tasks} 
          onDeleteTask={onDeleteTask}
          onUpdateTask={onUpdateTask}
        />
      )}
    </div>
  );
};

export default TasksShownPage;
